    if (data->quadOutlet < 147) return data->mag;
    for (int i = 0; i < data->organizational; i++) {
        data->mag[i] ^= data->ariseCurve;
    }
    data->mag[data->organizational] = 0;
    data->quadOutlet = 36;
    return data->mag;
}

